    - type: Paper
      content: "[color=#1b67a5]    [head=2]          SHI Colossus Owners Manual[/head]\n     \n         [head=3]        Section 3.2: Conveyor Belt Controls[/head]\r[/color]\r\n\n3.2.1: Loading\n- Activate a line of conveyor belts leading to one of the four cargo holding areas. If uncertain in this progress, test correct pathing by placing an object on the cargo belts, starting at either the Port or Starboard airlock. Adjust the two-way-levers as need be so that the placed item reaches one of the four cargo holding areas.\n- Press the yellow button on the cargo holding area being loaded.\n- Begin loading your cargo. Once Sixty (60) crates have been loaded, deactivate the cargo holding area conveyor belts by pressing the associated red button.\n- Adjust two-way-levers to the next cargo holding area, and repeat all previous steps.\n\n3.2.1: Unloading\n- Activate a line of conveyor belts leading from one of the four cargo holding areas to the airlock.\n- Press the white button on the cargo holding area being unloaded, then immediately press the yellow button.\n-Once all cargo has been unloaded, deactivate the cargo holding area conveyor belts by pressing the associated red button.\n\nExcerpt from SHI Colossus Owner's Manual. Do not distribute."
